import './App.css';
import Entry from "./entry";
import Header from "./Header";
import {Route, Routes} from "react-router-dom";



function App() {
  return (
    <Routes>
      <Route index element={
          <main>
          <Header />

          <div className="entries">
            <Entry />
            <Entry />
            <Entry />

          </div>

        </main>
      } />
      <Route path={'/login'} element={
        <div>Login Page</div>


      } />

    </Routes>

  );
}

export default App;
